import React from "react";
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

const Signup = () => {
  return (
    <div className="text-red-500">
      <div className="h-full w-full p-8 shadow-md bg-green-400 rounded-md bg-clip-padding backdrop-filter backdrop-blur-lg bg-opacity-10 border border-gray-100">
        <h1 className="text-3xl font-bold text-center text-blue-300">Signup</h1>
        <div>
        <TextField id="outlined-basic" label="fullName" variant="outlined" />
        </div>
      </div>
    </div>
  );
};

export default Signup;
